import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";

const ReadOrder = () => {
    const [orders, setOrder] = useState([]);



    const getOrders = async () => {
        const result = await axios.get("http://localhost:3003/users");
        setOrder(result.data.reverse());
    };

    useEffect(() => {
        getOrders();
    }, []);

    const deleteUser = async id => {
        await axios.delete(`http://localhost:3003/users/${id}`);
        getOrders();
    };

    return (
        <div className="container">
            <div className="py-4">
                <h1>Read Order</h1>
                <table class="table border shadow">
                    <thead className='thead-dark'>
                        <tr>
                            <th>displayOrderId</th>
                            <th>customerName </th>
                            <th>productName</th>
                            <th>mobileNo</th>
                            <th>modelNo</th>
                            <th>brandName</th>
                            <th>ProductColor </th>
                            <th>category</th>
                            <th>subCategory</th>
                            <th>discription</th>
                            <th>orderDate </th>
                            <th>expectedDeliveryDate</th>
                            <th>logisticName</th>
                            <th>awbNo</th>
                            <th>couponCode </th>
                            <th>action </th>
                        </tr>
                    </thead>
                    <tbody>
                        {orders.map((orders) => (
                            <tr key={orders.displayOrderId}>
                                <td >{orders.displayOrderId}</td>
                                <td>{orders.customerName}</td>
                                <td>{orders.productName}</td>
                                <td>{orders.mobileNo}</td>
                                <td>{orders.modelNo}</td>
                                <td>{orders.brandName}</td>
                                <td>{orders.ProductColor}</td>
                                <td>{orders.category}</td>
                                <td>{orders.subCategory}</td>
                                <td>{orders.discription}</td>
                                <td>{orders.orderDate}</td>
                                <td>{orders.expectedDeliveryDate}</td>
                                <td>{orders.logisticName}</td>
                                <td>{orders.awbNo}</td>
                                <td>{orders.couponCode}</td>
                                <td>
                                    <Link class="btn btn-primary mr-2" to={`/users/${user.id}`}>
                                        View
                                    </Link>
                                    <Link
                                        class="btn btn-outline-primary mr-2"
                                        to={`/users/edit/${user.id}`}
                                    >
                                        Edit
                                    </Link>
                                    <Link
                                        class="btn btn-danger"
                                        onClick={() => deleteUser(user.id)}
                                    >
                                        Delete
                                    </Link>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default ReadOrder;
